<script>
    var base64DefaultImage = "data:image/jpeg;base64,";
    var widget = {
        name: "emptyRadio",
        isFit: function(question) {
            return question.getType() === 'radiogroup';
        },
        isDefaultRender: true,
        afterRender: function(question, el) {
            var $el = $(el);
            $el.find("input:radio").click(function(event) {
                var UnCheck = "UnCheck",
                    $clickedbox = $(this),
                    radioname = $clickedbox.prop("name"),
                    $group = $('input[name|="' + radioname + '"]'),
                    doUncheck = $clickedbox.hasClass(UnCheck),
                    isChecked = $clickedbox.is(':checked');
                if (doUncheck) {
                    $group.removeClass(UnCheck);
                    $clickedbox.prop('checked', false);
                    question.value = null;
                } else if (isChecked) {
                    $group.removeClass(UnCheck);
                    $clickedbox.addClass(UnCheck);
                }
            });
        },
        willUnmount: function(question, el) {}
    };

    var bgSignatureWidget = {
        name: "drawingboard",
        title: "Drawing Board",
        isFit: function(question) {
            return question.getType() == "signaturepad";
        },
        isDefaultRender: true,
        init() {
            Survey.Serializer.addProperty("signaturepad", {
                name: "image",
                default: "",
                category: "general",
            });
        },
        afterRender: function(question, el) {
            console.log("MASUK");
            console.log(question.name);
            console.log("------");

            console.log(question.image);
            console.log("------");
            console.log(question.name == "question4");
            if (question.name == "question4") {
                var div = el.children[0];
                var canvas = el.children[0].children[0];
                var divBtn = el.children[1];
                var button = el.children[1].children[0];

                var bgCanvas = document.createElement("canvas");
                var clearButton = document.createElement("button");

                // Set styles for layering
                canvas.style = "z-index: 1; position: absolute;";
                bgCanvas.style = "z-index: 0; position: absolute;";

                bgCanvas.width = question.width;
                bgCanvas.height = question.height;
                canvas.width = question.width;
                canvas.height = question.height;

                divBtn.className += " mt-3";
                div.insertBefore(bgCanvas, canvas);
                div.style = "height:".concat(question.height).concat("px;");

                clearButton.innerHTML = "Clear";
                clearButton.style = "position: absolute; z-index: 2;";
                divBtn.insertBefore(clearButton, button);

                clearButton.addEventListener('click', function(event) {
                    question.value = base64DefaultImage;
                });

                const context = bgCanvas.getContext('2d');
                var img = new Image();
                img.src = question.image;
                img.onload = () => {
                    context.drawImage(img, 0, 0, question.width, question.height);
                };
                img.onerror = () => {
                    console.error("Error loading image: " + question.image);
                };
            }
        },
    };

    // Register the widget
    Survey.CustomWidgetCollection.Instance.addCustomWidget(bgSignatureWidget, "customtype");


